import s from './bascet.module.css';
import { getData } from '../../../store/selected';
import { useSelector } from 'react-redux';
import { useState } from 'react';


const Bascet = () => {
    let data;

    const dd = useSelector(getData);

    if (dd != null) {
        data = dd;
    } else {
        data = {};
    }


const clear = () => {
    localStorage.clear();
}

    return (

        <>

            {
                Object.values(data).map(([key, { name, id, image, species, status }]) =>
                    <div className={s.wrapper}>

                        <div className={s.text}>
                            <p>{name}</p>
                            <p>{status}</p>
                            <p>{species}</p>
                            <h1>{id}</h1>
                        </div>
                        <div className={s.img}>
                            <img src={image}></img>
                        </div>
                    </div>
                )
            }

            <div className={s.buy}>
                <h1>Купить сейчас</h1>
                <button>Buy</button>
                <button onClick = {clear()}>Clear</button>
            </div>


        </>

